Living for the sole aim of escaping! 

&lsquo;Light of Rusbella&rsquo; was a depressing romance novel.
Wishing for a new life, Asili Ros&eacute; was reborn as the 8th wife of the Estrian Emperor.
She thought she was born with a golden spoon, but it was actually just a gilded spoon?
Once she realized that nothing but ruin awaited, she found a diary foreshadowing the future...

It foretold Asili&rsquo;s death by the hands of the Crown Prince, Castor!

[&ldquo;What does the empire mean to you?&rdquo;
After asking this, the Crown Prince smiled so very beautifully. And then he killed me.]

Unfortunately, Asili kept coming back to life, and continued to be killed over and over again. As she continued to relive her deaths, she slowly lost her smile and changed.

&hellip;Let&rsquo;s try to survive first.
[hr]&ldquo;What can I do for my elder brother?&rdquo;

&ldquo;Well.&rdquo;
[hr]Pale sky blue hair fluttered finely in the wind. He smiled weakly, before parting his dry lips.

&ldquo;Call my name.&rdquo;
&ldquo;...&rdquo;

My head quickly snapped up.

&ldquo;Call me&hellip; Amoru.&rdquo;

His fingertips skimmed along my inner wrist.
